    <p class=MsoNormal style='text-align:justify'><b><span lang=ES-CO
    style='font-size:16.0pt;line-height:107%;font-family:"Century Gothic",sans-serif'>Mejor
    racha anotadora en Liga fuera de casa: 14 partidos (entre jornada 38 de

    <p class=MsoNormal style='text-align:justify'><b><span lang=ES-CO
    style='font-size:16.0pt;line-height:107%;font-family:"Century Gothic",sans-serif'>Mejor
    racha anotadora en Copa: 16 partidos (Copa 1972-73 a 1974-75) <o:p></o:p></span></b></p>
    <p class=MsoNormal style='text-align:justify'><b><span lang=ES-CO
    style='font-size:16.0pt;line-height:107%;font-family:"Century Gothic",sans-serif'>Mejor
    racha anotadora en Copa en casa: 10 (Copa 1942-43 a 1948-49) <o:p></o:p></span></b></p>
    <p class=MsoNormal style='text-align:justify'><b><span lang=ES-CO
    style='font-size:16.0pt;line-height:107%;font-family:"Century Gothic",sans-serif'>Mejor
    racha anotadora en Copa fuera de casa: 11 (Copa 1972-73 a 1974-75)<o:p></o:p></span></b></p>
    <p class=MsoNormal style='text-align:justify'><b><span lang=ES-CO
    style='font-size:16.0pt;line-height:107%;font-family:"Century Gothic",sans-serif'><o:p>&nbsp;</o:p></span></b></p>
    <p class=MsoNormal style='text-align:justify'><b><span lang=ES-CO
    style='font-size:16.0pt;line-height:107%;font-family:"Century Gothic",sans-serif'>Las
    poderosas Águilas del América se encuentran entre los mejores equipos del
    mundo siglo XXI en ranking <span class=GramE>IFFHS(</span>Federación
    Internacional de Historia y Estadística de Fútbol). Es el equipo mexicano
    mejor clasificado.<o:p></o:p></span></b></p>
